        assert_eq!(PythonVersion::PY38, PythonVersion::new(3, 8));
        assert_eq!(PythonVersion::PY39, PythonVersion::new(3, 9));
        assert_eq!(PythonVersion::PY310, PythonVersion::new(3, 10));
        assert_eq!(PythonVersion::PY311, PythonVersion::new(3, 11));
        assert_eq!(PythonVersion::PY312, PythonVersion::new(3, 12));
